import React from 'react';
import './Accueil.css';

function Accueil() {
  return (
    <>
      <header>
        <a href="#" className="logo">maroc</a>
        <nav className="navbar">
          <a href="#">Catégories</a>
          <a href="#">À propos</a>
          <a href="#">Contact</a>
        </nav>
        <div className="icons">
          <a href="#" className="fas fa-user"></a>
        </div>
      </header>

      <section
        className="intro-banner"
        style={{
          backgroundImage: `url(${process.env.PUBLIC_URL + '/zelij.png'})`
        }}
      >
        {/* ... */}
      </section>
    </>
  );
}

export default Accueil;
